import React from 'react';
import { ThemeConsumer } from '../../components/themeContext';

import './style.scss';

const Card = ({ children }) => {
  return (
    <ThemeConsumer>
      {({ darkTheme }) => {
        return (
          <div className={`card ${darkTheme ? "dark" : null}`}>
            {children}
          </div>
        )}
      }
    </ThemeConsumer>
  )
};

export default Card;
